-- ----------------------------
-- Table structure for info_discipline
-- ----------------------------
DROP TABLE IF EXISTS `info_discipline`;
CREATE TABLE `info_discipline` (
`id_id`  char(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '专业ID' ,
`id_name`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '专业名称' ,
`id_teacher`  char(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '专业负责人' ,
`id_time`  int(4) UNSIGNED NOT NULL COMMENT '专业年级' ,
`ico_id`  char(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '学院ID' ,
PRIMARY KEY (`id_id`),
FOREIGN KEY (`ico_id`) REFERENCES `info_college` (`ico_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
UNIQUE INDEX `unique_id_name` (`id_name`, `id_time`) USING BTREE ,
INDEX `ico_id` (`ico_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

;

