-- ----------------------------
-- Table structure for permission
-- ----------------------------
DROP TABLE IF EXISTS `permission`;
CREATE TABLE `permission` (
`p_id`  int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '权限ID' ,
`p_name`  char(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限名称' ,
`p_alias`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限别名' ,
`p_status`  tinyint(255) UNSIGNED NOT NULL DEFAULT 0 COMMENT '权限状态，0：有效，1：无效' ,
PRIMARY KEY (`p_id`),
UNIQUE INDEX `UKN` (`p_name`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=16

;

